import React, { Component } from 'react'

export class ConsultaVirtual extends Component {
    componentDidMount(){
        document.getElementById("loader").style.display = "none";
    }
    render() {
        return (
            <div>
                <h1>Consulta Virtual</h1>
            </div>
        )
    }
}

export default ConsultaVirtual
